import React from "react";
import HeaArrow from "../../components/HeaArr";
const OrdersClient = () => {
  return (
    <div>
      <HeaArrow />
      <h3
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
        }}
      >
        Mis pedidos
      </h3>
    </div>
  );
};

export default OrdersClient;
